import React from 'react';

function About () {
	return <div>
		<h2>Loading Elizabeth Tan's Portfolio</h2>
	<div>
	<iframe src="https://www.figma.com/embed?embed_host=share&url=https%3A%2F%2Fwww.figma.com%2Fproto%2FDTigwst0hMaW48m1Vm0ndY%2FPortfolio-Website" width="100%" height="1000" position="absolute" top="0" left="0" title="Figma Portfolio" allowfullscreen></iframe>
	</div>
	</div>
}
export default About;
